    return ( <div className="hello"> {props.mytext} </div>  );

}

function Items(props){
return (<a  href="hello"> {props.type}</a>


  );
}

function App() {
  return (
    <div className="App" >
       <nav>  <Items/>  </nav> 



      <h1> This is mi:<Helloworld mytext="hello world"/><Helloworld mytext="que pedo que pedo"/></h1> 
    </div>
  );
}

export default App;
